import React from 'react'

import { Container, Row, Col } from 'react-bootstrap';

const Footer = () => {
    return (
        <footer>
            <Conainer>
                <Row>
                    <Col className='text-center py-3'>
                        Copyright &copy; MusShop
                    </Col>
                </Row>
            </Conainer>
        </footer>
    )
}

export default Footer
